import React, { Component } from 'react';

class AdminProjectListElement extends Component {
  state = {};
  editUrl = '/editproject/' + this.props.project.id;
  deleteUrl = '/deleteproject/' + this.props.project.id;

  componentDidMount() {
    console.log(this.props.project);
  }

  render() {
    return (
      <React.Fragment>
        <div className="row">
          <div>{this.props.project.tittle}</div>
          <div>
            <a href={this.editUrl}>Edit</a>
          </div>
          <div>
            <a href={this.deleteUrl}>Delete</a>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default AdminProjectListElement;
